export default function Users({usersData}) {
    const users = usersData || [{
        first_name: 'Sam',
        avatar: 'http://placekitten.com/200/300',
        city: 'New York'
    }]
    const CardGenerator = () => {

        const Card = ({user}) => {
            return (
                <div style={{flex: '0 0 auto'}}>
                    <img src={user[1].avatar} />
                </div>
            )
        }
        users.forEach((user, i) => {
            return(
                <Card user={user} id={i} />
            )
        });

    }
    return(
        <div className="flex flex-no-wrap overflow-auto">
            <CardGenerator />
        </div>
    )
}
